public boolean matches(String seq) {
int len = seq.length();
if (len > queue.size())
return false;
List<Character> chars = queue.subList(0, len);
char[] seqChars = seq.toCharArray();
for (int i = 0; i < len; i++) {
Character found = Character.toLowerCase(chars.get(i));
Character check = Character.toLowerCase(seqChars[i]);
if (!found.equals(check))
return false;
return true;
}

private static Tag register(Tag tag) {
tag.setAncestor(defaultAncestor.tagName);
synchronized (tags) {
tags.put(tag.tagName, tag);
}
return tag;
}

public void consume(String seq) {
if (!matches(seq))
int len = seq.length();
if (len > queue.size())
for (int i = 0; i < len; i++) {
consume();
}

private Element popStackToSuitableContainer(Tag tag) {
while (!stack.isEmpty()) {
if (last().tag().canContain(tag))
return last();
}

